import React from 'react';
import './Banner.css';

const Banner = (props) => {
	const fadeOut = () => {
		
		props.trigger();
	};
	window.setTimeout(fadeOut, 1000);
	const message = 'Ramble on!';
	return (
		<div className="banner">
			<p>{message}</p>
		</div>
	);
}

export default Banner;
